                <img id='inputimage' alt='' src={imageUrl} width='500px' height='auto'/>
                {faces.map(box => {
                    return<div className="bounding-box" style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, left: box.leftCol}}></div>
                })}
            </div>
        </div>
    );
}

